import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

const Registration = () => {
  const [users, setUsers] = useState([]); // Change 'user' to 'users' and initialize as an array

  useEffect(() => {
    fetch("http://localhost:8000/students")
      .then((res) => {
        if (!res.ok) {
          throw new Error(`HTTP error! status: ${res.status}`);
        }
        return res.json();
      })
      .then((data) => setUsers(data)) // Set the fetched data to 'users' state
      .catch((err) => console.log("Fetch error: ", err.message));
  }, []);

  return (
    <div className="container">
      <h2>Registration Application</h2>
      <div className="table-container">
        <Link to="/user/create" className="btn btn-add">
          Add new Student
        </Link>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Email</th>
              <th>Date of Birth</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {users.map((user) => (
              <tr key={user.id}>
                <td>{user.id}</td>
                <td>{user.name}</td>
                <td>{user.email}</td>
                <td>{user.dob}</td>
                <td>
                  <a href="#" className="btn btn-info">
                    View
                  </a>
                  <a href="#" className="btn btn-primary">
                    Edit
                  </a>
                  <a href="#" className="btn btn-danger">
                    Delete
                  </a>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Registration;
